        <li><a href="#top-rated">Top Rated</a></li>
        <li><a href="#upcoming">Upcoming</a></li>
        <li className="search">
          <FontAwesomeIcon 
            icon={faSearch} 
            size="lg" 
            onClick={iconClick} 
          />
          <input 
            type="text" 
            placeholder="Title only" 
            onChange={handleSearch}
          />
        </li>
      </ul>
      <div className="search-wrapper">
        <div className="search-results">
          {imageSearch}
        </div>  
      </div>


	  </nav>



  	)	  
}



export default Navigation;
